  margin-top: 3rem;
}

/* Breadcrubs */
#breadcrumbs {
  margin: 0rem;
  padding-top: 1rem;
}

  #breadcrumbs ul {
    list-style: none;
    margin: 0;
    padding: 0;
    display: flex;
  }

  #breadcrumbs li {
    padding: 1rem 1.5rem;
    background: var(--primary-black);
    border-right: 1px solid var(--secundary-black);
    color: var(--primary-white);
  }

  #breadcrumbs i {
    padding-right: 1rem;
  }

  #breadcrumbs a {
    text-decoration: none;
    color: var(--primary-white);
  }

  #breadcrumbs li.active {
    border-bottom: 2px solid var(--primary-red);
  }

/* loading */
.loading {
  margin: 0 auto;
  width: 200px;
}

/* Read more */
.readMore a {
  display: block;
  color: var(--primary-black);
  background-color: var(--primary-white);
  width: 200px;
  text-align: center;
  padding: 0.5rem;
  text-decoration: none;
  font-weight: bold;
  transition: all 0.3s 0s ease-in-out;
  border-bottom: 2px solid var(--primary-black);
  border-right: 2px solid var(--primary-black);
  border-top: 2px solid var(--primary-red);
  border-left: 2px solid var(--primary-red);
}

  .readMore a:hover {
    border-bottom: 2px solid var(--primary-red);
    border-right: 2px solid var(--primary-red);
    border-top: 2px solid var(--primary-black);
    border-left: 2px solid var(--primary-black);
    color: var(--primary-white);
    background-color: var(--primary-black);
  } 

/* Im√°genes */
.heading-div {
  margin-top: 64px;
}

.heading-img {
  width: 100%;
}

.heading-img img {
  width: 100%;
}

.icon {
  width: 32px;
}

.with-icon {
  display: block;
  padding-left: 2rem;
  background-repeat: no-repeat;
  background-size: contain;
}

  .with-icon span {
    align-self: center;
    padding-left: 1rem;
  }

/* Iconos */
.iconPrice {
  background-image: url(../img/icons/price.svg);
}

.iconAuthor {
  background-image: url(../img/icons/author.svg);
}

.iconCharacters {
  background-image: url(../img/icons/characters.svg);
}

.iconStories {
  background-image: url(../img/icons/stories.svg);
}

.iconComics {
  background-image: url(../img/icons/comics.svg);
}

.iconTags {
  background-image: url(../img/icons/tags.svg);
}

/* About */
#about .listWrapper {
  background: var(--primary-black);
}

#about .container {
  max-width: 1300px;
  margin: 0 auto;
  padding: 0 1rem;
}

/* Animacionmes */
.latir {
  animation-name: latir;
  -webkit-animation-name: latir;
  animation-duration: 1.5s;
  -webkit-animation-duration: 1.5s;
  animation-iteration-count: infinite;
  -webkit-animation-iteration-count: infinite;
}

@keyframes latir {
	0% {
		transform: scale(0.9);
		opacity: 0.7;		
	}
	50% {
		transform: scale(1);
		opacity: 1;	
	}	
	100% {
		transform: scale(0.9);
		opacity: 0.7;	
	}			
}

@-webkit-keyframes latir {
	0% {
		-webkit-transform: scale(0.95);
		opacity: 0.7;		
	}
	50% {
		-webkit-transform: scale(1);
		opacity: 1;	
	}	
	100% {
		-webkit-transform: scale(0.95);
		opacity: 0.7;	
	}			
}

